    false,nt"url": null,nt"notes": "This annual narrative report for Ravalli
    National Wildlife Refuge outlines Refuge accomplishments from July through December
    of 1975. The report begins with an introduction to the Refuge and information about
    climatic and habitat conditions, and land acquisition. Construction is also described.
    Habitat management is covered; croplands and grasslands are discussed. The wildlife
    section of the report discusses migratory birds. Interpretation and recreation activities
    are outlined; topics include recreation and law enforcement. Field investigations,
    cooperative programs, items of interest, and safety information are discussed. Items
    of interest and photographs are attached.",nt"license_title": "License Not
